s($,"atX","ahq",()=>{var q="Bruno Gottlieb",p="Simbox Studios",o="LabInter UFSM",n="Triplano",m=t.s
return A.a([A.br("Rogue Masters","Advance Garde",B.a1,A.a(["Rogue Masters \xe9 um souls-like cooperativo, onde o objetivo \xe9 combater a entropia em intensas batalhas de hordas, jog\xe1veis em at\xe9 6 jogadores. O jogo tamb\xe9m oferece, em seu early access, um modo deathmatch e um modo versus. Como um dos pontos mais interessantes, possui um amplo sistema de transmogrifica\xe7\xe3o, onde os jogadores podem alterar a apar\xeancia de seus equipamentos sem modificar suas estat\xedsticas.","\nPara mim, foi uma honra entrar para o time de desenvolvimento, pois sempre admirei muito o estilo souls. Trabalhar em um jogo cooperativo, lan\xe7ado na Steam, foi uma grande oportunidade para aprimorar minhas habilidades. Durante os dois anos em que atuei no projeto, trabalhei com funcionalidades de networking, server, cloud saving, localiza\xe7\xe3o, al\xe9m de implementar recursos como o mapeamento de teclas e a UI como um todo.","\nDesenvolver um jogo multijogador deste porte foi, potencialmente, a experi\xeancia mais desafiadora do projeto. Garantir que o jogo funcione corretamente em sincronia para todos os jogadores demandou bastante trabalho da equipe e do processo de controle de qualidade.","\nAl\xe9m dos aspectos t\xe9cnicos, um dos pontos altos desse per\xedodo foi a din\xe2mica da equipe. Sempre senti o ambiente altamente colaborativo e divertido, onde a comunica\xe7\xe3o flu\xeda de maneira eficiente e todos estavam comprometidos com o projeto. Acredito que essa intera\xe7\xe3o tenha enriquecido n\xe3o apenas o jogo, mas tamb\xe9m \xe0 mim.","\nVer meu nome nos cr\xe9ditos de um jogo na Steam \xe9 tamb\xe9m um passo adiante na minha carreira. Saber que contribu\xed para um projeto que gosto e que tamb\xe9m pode ser apreciado por outros jogadores \xe9 algo que me deixa contente. Espero que venham mais projetos como este."],m),A.a(["images/rogueMasters/RogueMasters_1.jpg","images/rogueMasters/RogueMasters_2.jpg","images/rogueMasters/RogueMasters_3.jpg","images/rogueMasters/RogueMasters_4.jpg","images/rogueMasters/RogueMasters_5.jpg","images/rogueMasters/RogueMasters_6.jpg","images/rogueMasters/RogueMasters_7.jpg"],m)),A.br("Truck Simulator","Rota Simuladores",B.a1,A.a(["\nProjeto desenvolvido atrav\xe9s da Rota Simuladores, com o objetivo de servir como uma ferramenta auxiliar para motoristas de \xf4nibus e caminh\xf5es, oferecendo simula\xe7\xf5es realistas de f\xedsica e dirigibilidade. Al\xe9m da simula\xe7\xe3o de ve\xedculos, tamb\xe9m foi criado um sistema para a elabora\xe7\xe3o de aulas personalizadas, oferecendo uma ampla gama de aplica\xe7\xf5es para instrutores. Atuei neste projeto como desenvolvedor principal.","\nO desenvolvimento deste projeto foi desafiador devido \xe0 necessidade de compreender detalhadamente o funcionamento mec\xe2nico dos ve\xedculos e traduzir essa l\xf3gica para o ambiente virtual. A simula\xe7\xe3o realista exigiu a aplica\xe7\xe3o intensiva de conceitos de f\xedsica da engine, assegurando que as din\xe2micas de movimento, frenagem e manuseio dos ve\xedculos fossem representadas com precis\xe3o.","\nO simulador \xe9 compat\xedvel com o hardware da Rota Simuladores, o qual consta nas imagens, incluindo tamb\xe9m os dispositivos G29 e G920 da Logitech, assim como PC e joysticks."],m),A.a(["images/truck/Truck_3.jpg","images/truck/Truck_2.jpg","images/truck/Truck_1.jpg","images/truck/Truck_4.jpg","images/truck/Truck_5.jpg"],m)),A.br("Deepest Trench","Main Leaf",B.a1,A.a(["\nDeepest Trench \xe9 um jogo de explora\xe7\xe3o mar\xedtima. O jogo \xe9 ambientado nas profundezas do oceano, onde o jogador encontra-se numa base abandonada e precisa trabalhar em equipe para desbravar os mist\xe9rios ali contidos. Combinando elementos de mist\xe9rio e explora\xe7\xe3o, o jogo oferece uma experi\xeancia que desafia os jogadores a resolverem enigmas enquanto desbravam o ambiente.","\nEste t\xedtulo pode ser jogado tanto em modo solo, quanto em modo cooperativo. H\xe1 tamb\xe9m suporte ao Remote Play via Steam e layout para teclado e joystick. Minhas contribui\xe7\xf5es ao projeto concentraram-se principalmente no desenvolvimento da UI e elementos associados \xe0 ela. Tamb\xe9m contribu\xed com a implementa\xe7\xe3o de alguns elementos de gameplay, garantindo que as mec\xe2nicas fossem coerentes com a narrativa e o fluxo de jogo.","\nO jogo foi lan\xe7ado oficialmente em 30 de outubro de 2024, sendo este o segundo jogo presente na Steam a ter meu nome nos cr\xe9ditos."],m),A.a(["images/deepestTrench/deepest_1.jpg","images/deepestTrench/deepest_2.jpg","images/deepestTrench/deepest_3.jpg","images/deepestTrench/deepest_4.jpg"],m)),A.br("Souls-Like Boss Combat",q,B.a1,A.a(["Esse projeto surgiu atrav\xe9s da minha paix\xe3o por Dark Souls. Sempre admirei o sistema de combate souls, ent\xe3o resolvi aproveitar a oportunidade para fazer um projeto onde o intuito fosse batalhar contra um chefe, usando as mec\xe2nicas tradicionais.","\nPor tr\xe1s das cortinas havia um motivo que me fazia querer investir ainda mais nesse projeto, que era a oportunidade de me aperfei\xe7oar em anima\xe7\xf5es de modo geral e na l\xf3gica de movimenta\xe7\xe3o e intera\xe7\xe3o de personagens. O que ainda \xe9, at\xe9 hoje, o projeto que mais me possibilitou crescer neste t\xf3pico.","\nAproveitando o meu estudo, resolvi disponibilizar um v\xeddeo demonstrativo do projeto no Youtube e posteriormente disponibilizei o c\xf3digo fonte no GitHub para quem pudesse se beneficiar dele.","\nPor fim, acabou sendo uma boa abordagem pois foi interessante ver a intera\xe7\xe3o do p\xfablico e me motivou a seguir com esse tipo de projeto, posteriormente entrando para o time do Rogue Masters; projeto onde trabalhei durante dois anos e consta no topo deste portf\xf3lio.","\nAinda possuo planos de fazer um projeto de combate mais aprimorado utilizando a Unreal Engine 5 em algum futuro pr\xf3ximo."],m),A.a(["images/soulsLike/SoulsLike_1.jpg","images/soulsLike/SoulsLike_2.jpg","images/soulsLike/SoulsLike_3.jpg","images/soulsLike/SoulsLike_4.jpg"],m)),A.br("HDRP Souls",q,B.a1,A.a(["Eis que 4 anos ap\xf3s eu ter desenvolvido o Souls-Like Boss Combat e publicado o projeto no Youtube e GitHub, eu resolvo fazer uma vers\xe3o aprimorada deste projeto.","\nA nova vers\xe3o utiliza o HDRP e possui anima\xe7\xf5es muito mais flu\xeddas. Para isso, utilizei um pacote de anima\xe7\xf5es com movimenta\xe7\xe3o 8D, juntamente com anima\xe7\xf5es criadas usando a ferramenta Muse da Unity, na qual gera anima\xe7\xf5es atrav\xe9s do uso de IA com interpola\xe7\xe3o de frames.","\nA IA tamb\xe9m foi bem aprimorada, agora utilizando States Machine e sendo muito mais modular do que antes. A nova vers\xe3o possui diferentes combos e rea\xe7\xf5es dependendo do posicionando e a\xe7\xf5es do jogador. Cada a\xe7\xe3o \xe9 facilmente flex\xedvel \xe0 mudan\xe7as.","\nTomei como inspira\xe7\xe3o a DLC do Elden Ring para iniciar esse projeto, fiquei instigado a estudar mais por gostar desse tipo de jogo e ver o qu\xe3o flu\xeddo s\xe3o os bosses da From Software. Creio que os projetos em que mais me aprimoro s\xe3o esses onde entro de cabe\xe7a e me esfor\xe7o muito durante muito tempo."],m),A.a(["images/hdrpSouls/hdrpSouls_1.jpg","images/hdrpSouls/hdrpSouls_2.jpg","images/hdrpSouls/hdrpSouls_3.jpg","images/hdrpSouls/hdrpSouls_4.jpg","images/hdrpSouls/hdrpSouls_5.jpg"],m)),A.br("Tropical Racing",p,B.a1,A.a(["Tropical Racing \xe9 um jogo de corrida arcade voltado para o uso em cockpits automobil\xedsticos com suporte \xe0 force feedback e motion feedback.","\nEsse foi o primeiro projeto em que tive contato com esse tipo de hardware. O pr\xf3prio contato com um jogo de corrida tamb\xe9m me auxiliou muito para o desenvolvimento do simulador automobil\xedstico posteriormente.","\nEste acabou sendo um dos projetos mais divertidos que participei, uma vez que seu desenvolvimento proporcionou uma \xf3tima intera\xe7\xe3o entre a equipe na \xe9poca, onde frequentemente disput\xe1vamos para ver quem era o jogador com melhor tempo.\nThis ended up being one of the most fun projects I participated in, as its development provided great interaction between the team at the time, where we often competed to see who was the player with the best time."],m),A.a([u.g,u.z],m)),A.br("Motorcycle Game",p,B.a1,A.a(["Com uma ideia bem similar \xe0 do Tropical Racing, esse jogo de motovelocidade estava sendo desenvolvido para o uso em hardware simulador de moto. Sendo o hardware desenvolvido na f\xe1brica da Rota Simuladores.","\nEntretanto, apesar da confec\xe7\xe3o do hardware, ao decorrer do processo o jogo acabou n\xe3o sendo conclu\xeddo. Como ele nunca chegou a levar um nome, deixarei aqui ao t\xedtulo de Motorcycle game."],m),A.a(["images/motorcycle/Motorcycle_1.jpg","images/motorcycle/Motorcycle_2.jpg","images/motorcycle/Motorcycle_3.jpg"],m)),A.br("Sky Crossing",p,B.dt,A.a(["\nEste foi o meu primeiro projeto envolvendo o desenvolvimento de jogos para Realidade Virtual, inicialmente utilizando Oculus Rift e Oculus Rift S. Posteriormente, tamb\xe9m tive a oportunidade de trabalhar com o Quest 2, ampliando ainda mais minha experi\xeancia na \xe1rea.","\nO jogo consiste em uma pequena cena projetada para centros de entretenimento, com o objetivo de simular uma travessia em grande altitude, proporcionando sensa\xe7\xf5es intensas de adrenalina aos jogadores."],m),A.a(["images/skyCrossing/SkyCrossing_1.jpg","images/skyCrossing/SkyCrossing_2.jpg"],m)),A.br("The Grand Sheriff",p,B.dt,A.a(["Assim como o Tropical Racing, esse jogo foi desenvolvido para ser usado com \xf3culos de realidade virtual em centros de entretenimento. Sendo assim, o segundo jogo em que tive contato com o desenvolvimento VR.","\nSeu objetivo \xe9 simular um tiroteio num cen\xe1rio de faroeste. O jogo \xe9 dividido em duas vers\xf5es, uma diurna e uma noturna, sendo essa segunda composta por maior n\xedvel de a\xe7\xe3o e dificuldade.","\nCom um foco na competitividade, ao final de cada partida \xe9 exibida a pontua\xe7\xe3o do jogador e inserida numa tabela de l\xedderes, processo realizado atrav\xe9s do v\xednculo com os servidores da Simbox Studios."],m),A.a([u.y,u.W],m)),A.br("Kam\xea Kanhru",o,B.ak,A.a(["Este \xe9 um projeto muito importante para mim, pois, foi o projeto em que me colocou no ramo de desenvolvimento de jogos. Ao final do segundo ano da faculdade de Ci\xeancia da Computa\xe7\xe3o, acabei chegando at\xe9 este projeto atrav\xe9s de uma indica\xe7\xe3o, o que mudaria o rumo da minha carreira da\xed em diante.","\nO projeto \xe9 sediado no Centro de Artes e Letras da Universidade Federal de Santa Maria (UFSM) e possui uma equipe multidisciplinar de variados cursos da pr\xf3pria universidade.","\nSeu intuito \xe9 manter viva a cultura Kaing\xe1ng atrav\xe9s de aprendizagem interativa, servindo assim, como ferramenta de ensino nas escolas ind\xedgenas. Aqui o jogador poder\xe1 ter contato com o idioma Kaing\xe1ng, atrav\xe9s da escrita e das falas, al\xe9m de aprender sobre a hist\xf3ria atrav\xe9s da intera\xe7\xe3o com elementos culturais importantes.","\nO jogo \xe9 composto de uma campanha principal em 3D e de mini jogos em 2D, acessados atrav\xe9s da campanha. Aqui nesse portf\xf3lio coloquei imagens apenas de alguns dos mini jogos, visto que o 3D ainda est\xe1 em desenvolvimento.","\nPara garantir a integridade do projeto, s\xe3o realizadas din\xe2micas entre escolas e comunidades Kaing\xe1ngs de Santa Maria RS e Tenente Portela RS. Dessa forma podemos interagir com os professores e com as crian\xe7as, o que me trouxe uma experi\xeancia totalmente diferente do que eu estava acostumado, uma vez que passei a ter uma vis\xe3o mais humanit\xe1ria e contato muito mais pr\xf3ximo do que o habitual apenas no curso de computa\xe7\xe3o.","\nO jogo ser\xe1 lan\xe7ado tanto para desktops quanto para dispositivos m\xf3veis, sendo a acessibilidade um de seus focos principais.","\nEncontro-me pr\xf3ximo ao time e ao projeto at\xe9 os dias atuais, entretanto, n\xe3o estou mais atuando como programador, visto que com o tempo precisei de mais tempo para focar em outros projetos."],m),A.a([u.h,u.x,u.P,u.A,u.D,u.Y,u.Q,u.d,u.f,u.Z],m)),A.br("Tigres e Cachorros",o,B.ak,A.a(["Estava eu numa tarde exibindo o Projeto Ind\xedgena Kam\xe9 Kanhru para o p\xfablico da cidade de Santa Maria, num evento da UFSM, quando um casal ind\xedgena vem at\xe9 minha banca e comenta sobre o Jogo dos Tigres e dos Cachorros.","\nEles comentaram sobre como o jogo \xe9 culturalmente jogado no ch\xe3o, fazendo as marca\xe7\xf5es das linhas no ch\xe3o com gravetos e usando gr\xe3os de feij\xe3o / arroz ou pedrinhas como pe\xe7as. Em seguida, conseguiram uma folha, para desenhar como era o tabuleiro, juntamente com algumas mi\xe7angas para usar como pe\xe7as e me ensinaram a jogar.","\nO jogo consiste numa partida entre dois jogadores, onde um comanda dois tigres e outro comanda os cachorros. Os tigres vencem o jogo ap\xf3s comer um certo n\xedvel de cachorros. Os cachorros vencem ap\xf3s encurralar os tigres, deixando-os sem casas livres para se movimentar. Em geral \xe9 um bom jogo de estrat\xe9gia e que demonstra conceitos de trabalho em equipe.","\nFalando um pouco de seu desenvolvimento, resolvi aproveitar a oportunidade e torn\xe1-lo multijogador local e online. Foi a primeira vez em que tive contato com alguma networking na Unity. Nesse caso, a Photon Framework. O que serviu de grande aprendizado para troca de mensagens via RPC, uma vez que mesmo atualmente usando o Mirror, a ideia \xe9 extremamente similar.","\nO fato do jogo ser multijogador online permite algo que antes ainda n\xe3o era poss\xedvel: a intera\xe7\xe3o entre jogadores de diferentes comunidades ao redor do pa\xeds. Acredito que atualmente ainda n\xe3o h\xe1 dispon\xedvel outra vers\xe3o desse jogo com esse mesmo prop\xf3sito."],m),A.a([u.r,u.F,u.X,u.G,u.u,u.R],m)),A.br("Santa is Late for Christmas!",n,B.a1,A.a(["Este foi um projeto de duas semanas, oriundo de um processo seletivo onde o objetivo era fazer um jogo estilo endless runner para mobile. Optei por utilizar a tem\xe1tica natalina e acabei gostando do resultado. A programa\xe7\xe3o desse projeto possui alguns diferenciais, a exemplo, foi a primeira vez que utilizei o New Input System."],m),A.a(["images/santa/santaMedley.jpg"],m)),A.br("FastRak",n,B.ak,A.a(["Este projeto, na verdade, n\xe3o trata-se de um jogo mas sim de um aplicativo. Entretanto ele demonstrou-se bem desafiador e usa diversos elementos complexos, ent\xe3o achei muito v\xe1lido de p\xf4r aqui neste portf\xf3lio.","\nTrata-se de um aplicativo de ca\xe7a para ser utilizado em territ\xf3rio estadunidense. Toda a interface do aplicativo funciona em conjunto com o backend, solicitando e enviando informa\xe7\xf5es atrav\xe9s de rotas implementadas com o servidor AWS.","\nDentre suas principais fun\xe7\xf5es, destacam-se: Tela de login / cadastro, confirma\xe7\xe3o de OTP via e-mail, login com rede social, informa\xe7\xf5es completas de clima (atrav\xe9s da API do OpenWeather), mapa interativo (atrav\xe9s do SDK do MapBox), informa\xe7\xf5es de propriedade (atrav\xe9s da API do ReportAllUSA), cena de simula\xe7\xe3o com cervo em 3D, question\xe1rios, listas de seguidores, feed de rede social, envio de imagens, tracking com GPS, chat, notifica\xe7\xf5es, dentre outros."],m),A.a(["images/fastRak/fastRak_1.jpg","images/fastRak/fastRak_2.jpg","images/fastRak/fastRak_3.jpg","images/fastRak/fastRak_4.jpg"],m)),A.br("Pong ML",q,B.ak,A.a(["A hist\xf3ria desse projeto \xe9 a seguinte: Estava eu cursando a disciplina de Intelig\xeancia Artificial na faculdade e precisava escolher um t\xf3pico de Redes Neurais para fazer um trabalho pr\xe1tico / te\xf3rico. Com isso, eu j\xe1 ciente da exist\xeancia da ferramenta ML-Agents da Unity, resolvi escolher o t\xf3pico de Machine Learning.","\nTendo o t\xf3pico escolhido e j\xe1 estudado a parte te\xf3rica, resolvi aplicar os conhecimentos na pr\xe1tica. Assim, pensei comigo mesmo: preciso de um jogo que seja multijogador, r\xe1pido de implementar e que seja divertido de jogar. A\xed que surge o cl\xe1ssico Pong na hist\xf3ria.","\nMeu principal objetivo com isso era sanar algumas d\xfavidas, tais como: 1. Consigo implementar uma IA capaz de derrotar um humano? 2. Qual ser\xe1 o comportamento desta IA, ela ir\xe1 se parecer com um jogador humano? 3. Quanto tempo ser\xe1 necess\xe1rio para trein\xe1-la?","\nEm resumo, criei duas vers\xf5es da IA. A 1.0 tendo treinado por 7 minutos, resultando numa acur\xe1cia de 80% e varia\xe7\xe3o de 20%; e a 2.0 tendo treinado por 3 horas, resultando numa acur\xe1cia de 99.4% e varia\xe7\xe3o de 1%.","\nAl\xe9m da sala de aula, cheguei a ministrar uma oficina de Machine Learning utilizando esse projeto no Centro de Artes e Letras da UFSM, explicando os conceitos b\xe1sicos de ML e permitindo a intera\xe7\xe3o das pessoas com o jogo. Esta foi uma boa oportunidade de espalhar o conhecimento."],m),A.a(["images/pongML/PongML_1.png","images/pongML/PongML_2.png"],m)),A.br("Lunar Lander",q,B.ak,A.a(["Lunar Lander foi o segundo jogo que desenvolvi na Unity. Considero ele parte fundamental do come\xe7o da minha jornada como desenvolvedor de jogos e sempre o levo com bastante carinho na mem\xf3ria.","\nAqui o jogador deve controlar uma nave espacial usando os comandos de toque na tela e rota\xe7\xe3o do dispositivo m\xf3vel atrav\xe9s do aceler\xf4metro. O jogo possui 10 fases com dificuldade progressiva e o objetivo de cada uma delas \xe9 pousar a nave em seguran\xe7a no destino indicado.","\nApesar dos gr\xe1ficos e UI serem totalmente primitivos, acredito que seja um jogo divertido de modo geral e mostra a minha evolu\xe7\xe3o como desenvolvedor."],m),A.a(["images/lunarLander/LunarLander_1.jpg","images/lunarLander/LunarLander_2.jpg","images/lunarLander/LunarLander_3.jpg"],m)),A.br("Pinky Lander",q,B.ak,A.a(["Com o surgimento do sistema de ilumina\xe7\xe3o 2D da Unity, senti vontade de fazer um projeto para test\xe1-lo na pr\xe1tica. Assim surgiu Pinky Lander, meio como um sucessor do Lunar Lander.","\nA ideia aqui \xe9 bem similar, o jogador controla uma esp\xe9cie de nave atrav\xe9s do aceler\xf4metro do celular e toques na tela. Com adi\xe7\xe3o de algumas mec\xe2nicas, como a de toque com um dedo para acelera\xe7\xe3o lenta e dois dedos para acelera\xe7\xe3o r\xe1pida. Outra mec\xe2nica \xe9 que agora o dano de colis\xe3o passou a ser bem menos punitivo, apenas em casos de velocidade muito alta.","\nA minha ideia inicial era p\xf4r o jogo na Play Store, entretanto, devido \xe0 m\xe1 otimiza\xe7\xe3o da ilumina\xe7\xe3o 2D em dispositivos m\xf3veis na \xe9poca, o projeto acabou ficando engavetado. Agora durante o desenvolvimento deste site resolvi resgatar o projeto e ver como ele est\xe1. Notei que algumas luzes acabaram se comportando de maneira estranha na transi\xe7\xe3o do projeto para a Unity 2022.2.0f1, no fim \xe9 uma daquelas coisas que tenho vontade de ajeitar mas que potencialmente jamais ser\xe1 feito."],m),A.a([u.j,u.l,u.m,u.a,u.C,u._,u.e],m)),A.br("Insomnia",q,B.ak,A.a(["O surgimento de Insomnia \xe9 uma hist\xf3ria peculiar, nascida de uma necessidade pessoal. Num dia de recesso do trabalho, me vi em uma situa\xe7\xe3o em que meus hor\xe1rios estavam completamente trocados, dormindo durante o dia e ficando acordado \xe0 noite. Percebi que precisava tomar alguma atitude a respeito. Precisava buscar algo para ocupar meu tempo durante o dia todo, de modo a permanecer acordado at\xe9 a noite seguinte, quando poderia dormir e regularizar meu hor\xe1rio. Foi ent\xe3o que me sentei em frente ao computador. Decidi que faria algo, qualquer coisa - um projeto, um jogo; afinal, era o que sabia fazer. E assim, ap\xf3s 12 horas consecutivas de desenvolvimento, surge-se o prot\xf3tipo de Insomnia. O nome, uma homenagem ao seu prop\xf3sito original, traduz justamente essa jornada de ajuste do ciclo de sono.","\nO resultado foi duplamente positivo: n\xe3o apenas consegui ajustar meu hor\xe1rio de sono, mas tamb\xe9m criei um jogo divertido para dispositivos m\xf3veis. Aproveitei a oportunidade para estudar os servi\xe7os da PlayGames, incorporando conquistas e tabelas de lideran\xe7a ao jogo.","\nInspirado no estilo arcade cl\xe1ssico, Insomnia coloca o jogador no controle de uma nave espacial. O objetivo \xe9 avan\xe7ar enquanto enfrenta uma variedade de inimigos. Cada inimigo possui uma cor espec\xedfica e um comportamento \xfanico, exigindo do jogador adaptabilidade e estrat\xe9gias para supera-los. \xc0 medida que o jogador avan\xe7a, novos inimigos surgem, aumentando gradualmente a dificuldade."],m),A.a(["images/Insomnia/insomnia_1.png"],m))],A.af("w<lN>"))})
s($,"atW","ahp",()=>{var q="Bruno Gottlieb",p="Simbox Studios",o="LabInter UFSM",n="Triplano",m=t.s
return A.a([A.br("Rogue Masters","Advance Garde",B.a1,A.a(["Rogue Masters is a cooperative souls-like game, where the objective is to combat entropy in intense horde battles, playable with up to 6 players. The game also offers, in its early access, a deathmatch mode and a versus mode. As one of the most interesting points, it has an extensive transmogrification system, where players can change the appearance of their equipment without modifying their statistics.","\nFor me, it was an honor to join the development team, as I have always greatly admired the souls style. Working on a cooperative game, released on Steam, was a great opportunity to improve my skills. During the two years that I worked on the project, I worked with networking, server, cloud saving, localization functionalities, in addition to implementing features such as key mapping and the UI as a whole.","\nDeveloping a multiplayer game of this size was, potentially, the most challenging experience of the project. Ensuring that the game works correctly in sync for all players required a lot of work from the team and the quality control process.","\nIn addition to the technical aspects, one of the highlights of this period was the team dynamics. I always felt the environment was highly collaborative and fun, where communication flowed efficiently and everyone was committed to the project. I believe that this interaction has enriched not only the game, but also me.","\nSeeing my name in the credits of a game on Steam is also a step forward in my career. Knowing that I contributed to a project that I like and that can also be enjoyed by other players is something that makes me happy. I hope there are more projects like this."],m),A.a(["images/rogueMasters/RogueMasters_1.jpg","images/rogueMasters/RogueMasters_2.jpg","images/rogueMasters/RogueMasters_3.jpg","images/rogueMasters/RogueMasters_4.jpg","images/rogueMasters/RogueMasters_5.jpg","images/rogueMasters/RogueMasters_6.jpg","images/rogueMasters/RogueMasters_7.jpg"],m)),A.br("Truck Simulator","Rota Simuladores",B.a1,A.a(["\nProject developed through Rota Simuladores, with the aim of serving as an auxiliary tool for bus and truck drivers, offering realistic physics and drivability simulations. In addition to vehicle simulation, a system was also created for creating personalized classes, offering a wide range of applications for instructors. I worked on this project as main developer.","\nThe development of this project was challenging due to the need to understand in detail the mechanical functioning of the vehicles and translate this logic into the virtual environment. The realistic simulation required the intensive application of engine physics concepts, ensuring that the dynamics of vehicle movement, braking and handling were accurately represented.","\nThe simulator is compatible with Rota Simulators hardware, which appears in the images, also including Logitech's G29 and G920 devices, as well as PC and joysticks."],m),A.a(["images/truck/Truck_3.jpg","images/truck/Truck_2.jpg","images/truck/Truck_1.jpg","images/truck/Truck_4.jpg","images/truck/Truck_5.jpg"],m)),A.br("Deepest Trench","Main Leaf",B.a1,A.a(["\nDeepest Trench is a sea exploration game. The game is set in the depths of the ocean, where the player finds himself in an abandoned base and needs to work as a team to uncover the mysteries contained there. Combining elements of mystery and exploration, the game offers an experience that challenges players to solve puzzles while exploring the environment.","\nThis title can be played both solo and cooperatively. There is also support for Remote Play via Steam and a keyboard and joystick layout. My contributions to the project focused mainly on the development of the UI and elements associated with it. I also contributed to the implementation of some gameplay elements, ensuring that the mechanics were coherent with the narrative and game flow.","\nThe game was officially released on October 30, 2024, making this the second game on Steam to have my name in the credits."],m),A.a(["images/deepestTrench/deepest_1.jpg","images/deepestTrench/deepest_2.jpg","images/deepestTrench/deepest_3.jpg","images/deepestTrench/deepest_4.jpg"],m)),A.br("Souls-Like Boss Combat",q,B.a1,A.a(["This project came about through my passion for Dark Souls. I've always admired the souls combat system, so I decided to take the opportunity to do a project where the aim was to battle a boss, using traditional mechanics.","\nBehind the scenes there was a reason that made me want to invest even more in this project, which was the opportunity to improve myself in animation in general and in the logic of character movement and interaction. Which is still, to this day, the project that allowed me to grow the most in this topic.","\nTaking advantage of my study, I decided to make a demonstrative video of the project available on YouTube and later made the source code available on GitHub for anyone who could benefit from it.","\nFinally, it ended up being a good approach as it was interesting to see the public's interaction and motivated me to continue with this type of project, later joining the Rogue Masters team; project where I worked for two years and is at the top of this portfolio.","\nI still have plans to make a more improved combat project using Unreal Engine 5 in the near future."],m),A.a(["images/soulsLike/SoulsLike_1.jpg","images/soulsLike/SoulsLike_2.jpg","images/soulsLike/SoulsLike_3.jpg","images/soulsLike/SoulsLike_4.jpg"],m)),A.br("HDRP Souls",q,B.a1,A.a(["4 years after I developed Souls-Like Boss Combat and published the project on Youtube and GitHub, I decided to make an improved version of this project.","\nThe new version uses HDRP and has much more fluid animations. To do this, I used an animation package with 8D movement, along with animations created using Unity's Muse tool, which generates animations through the use of AI with frame interpolation.","\nThe AI \u200b\u200bhas also been greatly improved, now using States Machine and being much more modular than before. The new version has different combos and reactions depending on the player's positioning and actions. Each action is easily flexible to change.","\nI took the Elden Ring DLC \u200b\u200bas inspiration to start this project, I was encouraged to study more because I like this type of game and see how fluid From Software's bosses are. I believe that the projects in which I improve the most are the ones where I jump in head first and put in a lot of effort for a long time."],m),A.a(["images/hdrpSouls/hdrpSouls_1.jpg","images/hdrpSouls/hdrpSouls_2.jpg","images/hdrpSouls/hdrpSouls_3.jpg","images/hdrpSouls/hdrpSouls_4.jpg","images/hdrpSouls/hdrpSouls_5.jpg"],m)),A.br("Tropical Racing",p,B.a1,A.a(["Tropical Racing is an arcade racing game aimed at use in automobile cockpits with support for force feedback and motion feedback.","\nThis was the first project in which I had contact with this type of hardware. The contact with a racing game also helped me a lot in developing the car simulator later.","\nThis ended up being one of the most fun projects I participated in, as its development provided great interaction between the team at the time, where we often competed to see who was the player with the best time."],m),A.a([u.g,u.z],m)),A.br("Motorcycle Game",p,B.a1,A.a(["With a very similar idea to Tropical Racing, this motorcycle game was being developed for use on motorcycle simulator hardware. The hardware was developed at the Rota Simulators factory.","\nHowever, despite the hardware being made, during the process the game ended up not being completed. As it never got a name, I'll leave it here with the title of Motorcycle game."],m),A.a(["images/motorcycle/Motorcycle_1.jpg","images/motorcycle/Motorcycle_2.jpg","images/motorcycle/Motorcycle_3.jpg"],m)),A.br("Sky Crossing",p,B.dt,A.a(["\nThis was my first project involving the development of games for Virtual Reality, initially using Oculus Rift and Oculus Rift S. Later, I also had the opportunity to work with Quest 2, further expanding my experience in the area.","\nThe game consists of a small scene designed for entertainment centers, with the aim of simulating a crossing at high altitude, providing intense sensations of adrenaline to players."],m),A.a(["images/skyCrossing/SkyCrossing_1.jpg","images/skyCrossing/SkyCrossing_2.jpg"],m)),A.br("The Grand Sheriff",p,B.dt,A.a(["Like Tropical Racing, this game was developed to be used with virtual reality glasses in entertainment centers. Therefore, the second game in which I had contact with VR development.","\nYour objective is to simulate a shootout in a western setting. The game is divided into two versions, a daytime and a nighttime version, with the latter having a higher level of action and difficulty.","\nWith a focus on competitiveness, at the end of each match the player's score is displayed and inserted into a leaderboard, a process carried out through the link with Simbox Studios servers."],m),A.a([u.y,u.W],m)),A.br("Kam\xea Kanhru",o,B.ak,A.a(["This is a very important project for me, as it was the project that got me into the game development business. At the end of the second year of Computer Science college, I ended up coming to this project through a recommendation, which would change the direction of my career from then on.","\nThe project is based at the Center for Arts and Letters at the Federal University of Santa Maria (UFSM) and has a multidisciplinary team from various courses at the university itself.","\nIts aim is to keep the Kaing\xe1ng culture alive through interactive learning, thus serving as a teaching tool in indigenous schools. Here the player will be able to have contact with the Kaing\xe1ng language, through writing and speaking, in addition to learning about history through interaction with important cultural elements.","\nThe game is made up of a 3D main campaign and 2D mini games, accessed through the campaign. Here in this portfolio I only included images of some of the mini games, since 3D is still in development.","\nTo guarantee the integrity of the project, dynamics are carried out between schools and Kaing\xe1ng communities in Santa Maria RS and Tenente Portela RS. This way we can interact with the teachers and the children, which gave me a totally different experience than what I was used to, since I started to have a more humanitarian vision and much closer contact than usual only in the computing course. .","\nThe game will be released for both desktop and mobile devices, with accessibility being one of its main focuses.","\nI am close to the team and the project to this day, however, I am no longer working as a programmer, as over time I needed more time to focus on other projects."],m),A.a([u.h,u.x,u.P,u.A,u.D,u.Y,u.Q,u.d,u.f,u.Z],m)),A.br("Tigers and Dogs",o,B.ak,A.a(["I was showing the Kam\xe9 Kanhru Indigenous Project to the public in the city of Santa Maria one afternoon, at a UFSM event, when an indigenous couple came to my stall and commented on the Game of Tigers and Dogs.","\nThey commented on how the game is culturally played on the ground, marking lines on the ground with sticks and using grains of beans/rice or pebbles as pieces. Then they got a piece of paper to draw what the board looked like, along with some beads to use as pieces, and they taught me how to play.","\nThe game consists of a match between two players, where one commands two tigers and the other commands the dogs. Tigers win the game after eating a certain level of dogs. The dogs win after cornering the tigers, leaving them without free homes to move around. In general, it is a good strategy game that demonstrates teamwork concepts.","\nTalking a little about its development, I decided to take the opportunity and make it local and online multiplayer. It was the first time I had contact with any networking at Unity. In this case, the Photon Framework. This served as a great learning experience for exchanging messages via RPC, since even though we currently use Mirror, the idea is extremely similar.","\nThe fact that the game is online multiplayer allows something that wasn't possible before: interaction between players from different communities around the country. I believe that there is currently no other version of this game available for this same purpose."],m),A.a([u.r,u.F,u.X,u.G,u.u,u.R],m)),A.br("Santa is Late for Christmas!",n,B.a1,A.a(["This was a two-week project, arising from a selection process where the objective was to make an endless runner style game for mobile. I chose to use the Christmas theme and ended up liking the result. The programming of this project has some differences, for example, it was the first time I used the New Input System."],m),A.a(["images/santa/santaMedley.jpg"],m)),A.br("FastRak",n,B.ak,A.a(["This project, in fact, is not a game but an application. However, it proved to be very challenging and uses several complex elements, so I found it very worthwhile to include here in this portfolio.","\nIt is a hunting application to be used in US territory. The entire application interface works in conjunction with the backend, requesting and sending information through routes implemented with the AWS server.","\nAmong its main functions, the following stand out: Login / Registration screen, OTP confirmation via email, login with social network, complete weather information (through the OpenWeather API), interactive map (through the MapBox SDK), property information (through the ReportAllUSA API), 3D deer simulation scene, questionnaires, follower lists, social network feed, image sending, GPS tracking, chat, notifications, among others."],m),A.a(["images/fastRak/fastRak_1.jpg","images/fastRak/fastRak_2.jpg","images/fastRak/fastRak_3.jpg","images/fastRak/fastRak_4.jpg"],m)),A.br("Pong ML",q,B.ak,A.a(["The story of this project is as follows: I was studying Artificial Intelligence at college and I needed to choose a Neural Networks topic to do practical/theoretical work. As a result, I was already aware of the existence of Unity's ML-Agents tool, so I decided to choose the topic of Machine Learning.","\nHaving chosen the topic and having already studied the theoretical part, I decided to apply the knowledge in practice. So I thought to myself: I need a game that is multiplayer, quick to implement, and fun to play. That's when the classic Pong appears in history.","\nMy main objective with this was to resolve some doubts, such as: 1. Can I implement an AI capable of defeating a human? 2. What will the behavior of this AI be, will it resemble a human player? 3. How long will it take to train her?\nIn short, I created two versions of the AI. At 1.0 having trained for 7 minutes, resulting in an accuracy of 80% and variation of 20%; and 2.0 having trained for 3 hours, resulting in an accuracy of 99.4% and a variation of 1%.","\nIn addition to the classroom, I even taught a Machine Learning workshop using this project at the UFSM Center for Arts and Letters, explaining the basic concepts of ML and allowing people to interact with the game. It was a very nice opportunity to spread the knowledge."],m),A.a(["images/pongML/PongML_1.png","images/pongML/PongML_2.png"],m)),A.br("Lunar Lander",q,B.ak,A.a(["Lunar Lander was the second game I developed at Unity. I consider it a fundamental part of the beginning of my journey as a game developer and I always remember it very fondly.","\nHere the player must control a spaceship using touch commands on the screen and rotation of the mobile device through the accelerometer. The game has 10 phases with progressive difficulty and the objective of each of them is to land the ship safely at the indicated destination.","\nAlthough the graphics and UI are completely primitive, I believe it is a fun game overall and shows my evolution as a developer."],m),A.a(["images/lunarLander/LunarLander_1.jpg","images/lunarLander/LunarLander_2.jpg","images/lunarLander/LunarLander_3.jpg"],m)),A.br("Pinky Lander",q,B.ak,A.a(["With the emergence of Unity's 2D lighting system, I felt the urge to do a project to test it in practice. That's how Pinky Lander came about, kind of like a successor to Lunar Lander.","\nThe idea here is very similar, the player controls a kind of ship through the cell phone's accelerometer and touches on the screen. With the addition of some mechanics, such as tapping with one finger for slow acceleration and two fingers for fast acceleration. Another mechanic is that collision damage is now much less punishing, only in cases of very high speed.","\nMy initial idea was to put the game on the Play Store, however, due to the poor optimization of 2D lighting on mobile devices at the time, the project ended up being shelved. Now during the development of this site I decided to rescue the project and see how it is going. I noticed that some lights ended up behaving strangely when transitioning the project to Unity 2022.2.0f1, in the end it's one of those things that I want to fix but that will potentially never be done."],m),A.a([u.j,u.l,u.m,u.a,u.C,u._,u.e],m)),A.br("Insomnia",q,B.ak,A.a(["The emergence of Insomnia is a peculiar story, born of a personal need. On a day off from work, I found myself in a situation where my schedule was completely changed, sleeping during the day and staying awake at night. I realized I needed to do something about it. I needed to find something to occupy my time throughout the day, so I could stay awake until the next night, when I could sleep and adjust my schedule. It was then that I sat down in front of the computer. I decided I would do something, anything - a project, a game; after all, it was what he knew how to do. And so, after 12 consecutive hours of development, the Insomnia prototype emerged. The name, a tribute to its original purpose, reflects precisely this journey of adjusting the sleep cycle.","\nThe result was doubly positive: not only was I able to adjust my sleep schedule, but I also created a fun game for mobile devices. I took the opportunity to study PlayGames' services, incorporating achievements and leaderboards into the game.","\nInspired by classic arcade style, Insomnia puts the player in control of a spaceship. The objective is to advance while facing a variety of enemies. Each enemy has a specific color and unique behavior, requiring adaptability and strategies from the player to overcome them. As the player progresses, new enemies appear, gradually increasing the difficulty."],m),A.a(["images/Insomnia/insomnia_1.png"],m))],A.af("w<lN>"))})
